import React from 'react';
import './App.css';
import HomePage from './pages/HomePage';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function ResetScroll() {
  window.scrollTo(0, 0);
  return null;
}

function App() {
  return (
    <div className="App"> 
     <Router>
        <Route component={ResetScroll} />
        <Route path="/" exact>
          <HomePage />
        </Route>
      </Router>
    </div>
  );
}

export default App;
